import React, { Component } from 'react'

export default class YoutubeVideo extends Component {

    constructor() {
        super();
        this.state = {
            allDetails: {},
            videoURL: "",
            videoID: "fuck"
        }
    }

    componentWillMount() {

        this.setAllVariables();
    }

    setAllVariables() {
        this.setState({ allDetails: this.props.videoDetails })
        var videoId = "#" + this.state.allDetails['resourceId']['videoId']
        this.setState({ videoID: videoId });
    }

    render() {
        return (
            <div>
                <button type="button" className="btn btn-danger" data-toggle="modal" data-target="#beatrizVideo">
                    Watch
                  </button>
            </div>
        )
    }
}
